import React from "react";
import {NavItem, NavLink, Link, Nav} from "react-router-dom";
const Navigation = () => {
    // const loggedOut = () => {
    //     return (
    //         <div>
    //         <NavLink to="/login">Login</NavLink>
    //         <NavLink to="register">Sign Up</NavLink>
    //         </div>
    //     )
    // };

    return(
    <nav className="navbar navbar-expand-lg bg-light">
  <div className="container-fluid">
    <Link className="navbar-brand" to="/">Jobly</Link>
    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse right" id="navbarNav">
      <ul className="navbar-nav">
        <li className="nav-item">
          <NavLink className="nav-link active" aria-current="page" href="#">Home</NavLink>
        </li>
        <li className="nav-item">
          <NavLink className="nav-link" href="#">Features</NavLink>
        </li>
        <li className="nav-item">
          <NavLink className="nav-link" href="#">Pricing</NavLink>
        </li>
        <li className="nav-item">
          <a className="nav-link disabled">Disabled</a>
        </li>
      </ul>
    </div>
  </div>
</nav>
    )
}
export default Navigation;
